import Layout from '../components/Layout';

const About  = () => (

    <Layout>
        <div>
            <h1>About Page</h1>
            <img src="/funny.gif" alt="funny" />
            <p>
                This is some about me text -- Not serious about this as I have a different portfolio in development
            </p>
        </div>
    </Layout>
)

export default About;
